    false,nt"url": null,nt"notes": "NCEI Accession 0148022 includes physical,
    profile and underway data collected aboard the ROGER REVELLE during cruise RR1511
    in the Bay of Bengal, Indian Ocean and Laccadive Sea from 2015-08-04 to 2015-08-15.
    These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
    SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
    used to collect these data include ADCP, CTD and GPS. These data were collected
    by Hemantha Wijesekera of US Navy; Naval Research Laboratory - Washington DC, and
    by University of California - San Diego; Scripps Institution of Oceanography as
    part of Air-Sea Interactions in the Northern Indian Ocean (ASIRI)/Effects of Bay
    of Bengal Freshwater Flux on Indian Ocean Monsoon (EBoB). The Lamont-Doherty Earth
    Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored Rolling
    Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
    accession.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
